let imgLazyLoad=function(){var a=[].slice.call(document.querySelectorAll("img[data-lazyload-src]"));if("IntersectionObserver"in window){let e=new IntersectionObserver(function(a,t){a.forEach(function(a){if(a.isIntersecting){let t=a.target;t.src=t.dataset.lazyloadSrc,t.classList.add("bx-lazyload-success"),e.unobserve(t)}})});a.forEach(function(a){e.observe(a)})}else a.forEach(function(a){let e=new Image;e.src=a.dataset.lazyloadSrc,e.onload=function(){a.dataset.lazyloadSrc&&(a.src=a.dataset.lazyloadSrc),a.classList.add("bx-lazyload-success")}})};document.addEventListener("DOMContentLoaded",function(){imgLazyLoad()});